import React from "react";
import Navbar from "./Navbar";
import Head from "next/head";

import "../styles/index.scss";
export default class Layout extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <main>
        <Head>
          <title>سیم و کابل چلیپا</title>
        </Head>
        <Navbar />
        {this.props.children}
      </main>
    );
  }
}
